import React, {Component} from "react";
import Header from "./Header"
import Articles from "./Articles";

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {
            information : []
        }
        this.handleCreate = this.handleCreate.bind(this);
    }

    handleCreate(data) {
        this.setState({
            information : this.state.information.concat(data)
        });

        console.log("this.state.information", this.state.information)
    }

    render() {
        return (
            <div>
                <Header onTest = {this.handleCreate}/>
                <Articles articleLists = {this.state.information}/>
            </div>
        );
    }
}

export default Page;
